In this chapter, we are going to do what all other programming tutorials do: printing Hello World! In this series, I'm going to assume that you know a bit of C/C++ and x86-16 assembly, and know how to use Makefiles. So first make a folder. And open the folder in VS Code. Open Explorer in VS Code (via icon on top left or Ctrl+Alt+L). Right click and make a file called main.cpp: // main.cpp:
#include <stdio.h>
int main()
{ printf("Hello World!\n"); return 0;
} Make another file called Makefile: # Makefile
run : test.exe dosbox test.exe test.exe : main.obj wlink system dos option dosseg option quiet file { $< } name $@ main.obj : main.cpp wpp -0 -bt=dos -ms -s -wx -zq -fo="$@" "$<" clean : .SYMBOLIC -del test.exe main.obj main.err From the top, select Terminal/New Terminal or press Ctrl+Shift+` to open a terminal. You can use wmake run to build and run the program and wmake clean to clean anything that wmake run made VS Code doesn't know that we are using Watcom, to fix that we have to create a folder called .vscode (only setting for VS Code should be placed inside .vscode) and a file called c_cpp_properties.json inside: // c_cpp_properties.json
{ "env": { "defaultIncludes": [ "${WATCOM}/h", "./" ], // page 93 of cguide.pdf "defaultDefines": [ // enable one of these two // "__386__", "__I86__", "__X86__", "M_I86", "_M_I86", "_M_IX86=0", "__DOS__", "_DOS", "MSDOS", "__SMALL__=1", "_M_I86SM=__SMALL__", "M_I86SM=__SMALL__", "__cplusplus=1", "__WATCOMC__=1300", "_INTEGRAL_MAX_BITS=32", "_PUSHPOP_SUPPORTED=1", "__near=", "__watcall=", "far=", "interrupt=", "_interrupt=", "__interrupt=", "_dos_getvect(x)=0", "_chain_intr(x)=0", "asm=__asm", "__declspec(x)=", "__cdecl=", "" ] }, "configurations": [ { "name": "test.exe", "includePath": [ "${defaultIncludes}" ], "defines": [ "${defaultDefines}" ], "browse": { "limitSymbolsToIncludedHeaders": true, "databaseFilename": "${default}", "path": [ "${defaultIncludes}" ] }, "intelliSenseMode": "${default}", "cStandard": "c89", "cppStandard": "c++98", "configurationProvider": "ms-vscode.makefile-tools" } ], "version": 4
}
